import React, { useState } from "react";
import { FaUserCircle } from "react-icons/fa";
import { FaGoogle } from "react-icons/fa";
import { FaGithub } from "react-icons/fa";
import { FaDiscord } from "react-icons/fa";
import { Link, useNavigate } from "react-router";
import axios from "axios";
import { useDispatch } from "react-redux";
import { addUser } from "../store/userSlice";

function Login() {
  const navigate = useNavigate()
  const [activeTab, setActiveTab] = useState('login');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [name, setName] = useState('');
  const [error, setError] = useState(null);
  const dispatch = useDispatch();
  

  const handleTabChange = (tab) => {
    setEmail('');
    setPassword('');
    setName('');
    setActiveTab(tab);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    
    if (activeTab === 'login') {
      // Call API to authenticate user
      try {
        const res = await axios.post(
          "http://localhost:7777/api/v1/user/login",
          {
            email,
            password,
          },
          { withCredentials: true }
        );
        dispatch(addUser(res.data));
        return navigate("/");
      } catch (err) {
        setError(err?.response?.data || "Something went wrong");
      }
      console.log('Login form submitted:', email, password);
    } else {
      // Call API to create new user
      try {
        const res = await axios.post(
          "http://localhost:7777/api/v1/user/register",
          { name, email, password },
          { withCredentials: true }
        );
        dispatch(addUser(res.data.data));
        return navigate("/");
      } catch (err) {
        setError(err?.response?.data || "Something went wrong");
      }
      console.log('Signup form submitted:', name, email, password);
    }
    setEmail('');
    setPassword('');
    setName('');
  };
  const handleOutsideClick = (e) => {
    navigate("/");
  };

  return (
    <>
      <div
        onClick={handleOutsideClick}
        className="w-full backdrop-blur-sm top-0 absolute h-[120vh] z-10"
      ></div>

      <div className="md:px-36 md:py-10 px-6 py-6 rounded-full z-30 relative ">
        <div className=" border-black border-2 rounded-3xl  z-20 relative bg-blue-600 -rotate-2 ">
          <div className="flex justify-center items-center border-black border-2 bg-yellow-300 rotate-2 rounded-xl shadow-lg">
            <div className="md:w-1/2  h-full">
              <img
                className="ml-6 hidden md:block"
                src="data:image/png;base64,"
              />
            </div>
            <div className="md:w-1/2 w-full p-4 leading-loose">
              <div className="max-w-md mx-auto p-4 pt-6 md:p-6 lg:p-12 xl:p-24">
                <div className="flex flex-wrap justify-evenly text-xl font-bold mb-4">
                  <button
                    className={`tab-button ${
                      activeTab === "login" ? "active1" : ""
                    }`}
                    onClick={() => handleTabChange("login")}
                  >
                    Login
                  </button>
                  <button
                    className={`tab-button ${
                      activeTab === "signup" ? "active1" : ""
                    }`}
                    onClick={() => handleTabChange("signup")}
                  >
                    Signup
                  </button>
                </div>
                {activeTab === "login" ? (
                  <form onSubmit={handleSubmit} className="flex flex-col">
                    <label
                      className="text-lg text-gray-600 mb-2"
                      htmlFor="email"
                    >
                      Email
                    </label>
                    <input
                      type="email"
                      id="email"
                      value={email}
                      onChange={(event) => setEmail(event.target.value)}
                      className="w-full p-2 mb-4 border border-gray-300 rounded-lg"
                    />
                    <label
                      className="text-lg text-gray-600 mb-2"
                      htmlFor="password"
                    >
                      Password
                    </label>
                    <input
                      type="password"
                      id="password"
                      value={password}
                      onChange={(event) => setPassword(event.target.value)}
                      className="w-full p-2 mb-4 border border-gray-300 rounded-lg"
                    />
                    {error && <p className="text-red-600 mb-4">{error}</p>}
                    <button
                      type="submit"
                      className="bg-orange-500 hover:bg-orange-700 text-white font-bold py-2 px-4 rounded-lg"
                    >
                      Login
                    </button>
                  </form>
                ) : (
                  <form onSubmit={handleSubmit} className="flex flex-col">
                    <label
                      className="text-lg text-gray-600 mb-2"
                      htmlFor="name"
                    >
                      Name
                    </label>
                    <input
                      type="text"
                      id="name"
                      value={name}
                      onChange={(event) => setName(event.target.value)}
                      className="w-full p-2 mb-4 border border-gray-300 rounded-lg"
                    />
                    <label
                      className="text-lg text-gray-600 mb-2"
                      htmlFor="email"
                    >
                      Email
                    </label>
                    <input
                      type="email"
                      id="email"
                      value={email}
                      onChange={(event) => setEmail(event.target.value)}
                      className="w-full p-2 mb-4 border border-gray-300 rounded-lg"
                    />
                    <label
                      className="text-lg text-gray-600 mb-2"
                      htmlFor="password"
                    >
                      Password
                    </label>
                    <input
                      type="password"
                      id="password"
                      value={password}
                      onChange={(event) => setPassword(event.target.value)}
                      className="w-full p-2 mb-4 border border-gray-300 rounded-lg"
                    />
                    {error && <p className="text-red-600 mb-4">{error}</p>}
                    <button
                      type="submit"
                      className="bg-orange-500 hover:bg-orange-700 text-white font-bold py-2 px-4 rounded-lg"
                    >
                      Signup
                    </button>
                  </form>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Login;
